function MyPosts() {
	return (
		<div>
			My posts
			<div>
				<textarea></textarea>
				<button>Add Post</button>
			</div>
			<div className="posts">
				<div className="item1">
					<img src='https://lh3.googleusercontent.com/proxy/etupveXTi4r5k4vI9oLpXBpBXIpCVG4S55DUdNRmg6QiUO6WGtR92b_nAVRDne-qb09ZclUqXIKGSN-nTBPzthjHSZSeLH0_tczcGChMVhTPA9uuZmGjKluuXJDf9N_jWZMqqJXckRf1ZPBlo2ZNjuDX'></img>
					Post 1
				</div>
				<div className="item2">
					Post 2
				</div>
			</div>
		</div>
	)
};

export default MyPosts;
